import styled from "@emotion/styled";
import { Token } from "src/utils/token";
import { PoolIcon } from "src/components/PoolIcon";
import { Flex } from "theme-ui";
import { spellMap } from "src/config"

interface Props {
    name: string;
    wstaking: string | null;
    spell: string;
    tokens: Token[];
  }

export const FarmInfo: React.FC<Props> = ({ name, wstaking, spell, tokens }: Props) => {
  return (
    <Flex >
        <PoolIcon tokens={tokens} />
        <Flex sx={{justifyContent: "center" }}>
            <span>{spellMap.get(spell)} {name}</span>
        </Flex>
    </Flex>
  );
};

const Wrapper = styled.div`
  display: flex;
  align-items: center;
  gap: 8px;
  img {
    width: 32px;
    height: 32px;
    border-radius: 16px;
  }
`;
